export const toTitleCase = (str: string) =>
  str.replace(/(^\w|\s\w)/g, (m) => m.toUpperCase())

export const renderDate = (date: Date, full: boolean = true) => {
  if (full) {
    return date.toLocaleDateString('en', {
      month: 'long',
      day: 'numeric',
      year: 'numeric'
    })
  } else {
    return date.toLocaleDateString('en')
  }
}

export const getAllUniqueTags = (allPosts: any) => {
  const uniqueTags = [
    ...new Set(allPosts.map((post: any) => post.data.tags).flat())
  ]
  return uniqueTags
}

export const byTime = (a: any, b: any, desc: boolean = true): number => {
  if (desc) {
    return b.data.pubDate.getTime() - a.data.pubDate.getTime()
  } else {
    return a.data.pubDate.getTime() - b.data.pubDate.getTime()
  }
}

export const filterDrafts = (post: any): boolean => {
  return import.meta.env.PROD ? (post.data.draft ? false : true) : true
}

export const timeout = (ms: number) => {
  return new Promise((resolve) => setTimeout(resolve, ms))
}

export class TapTracker {
  lastTapTime = 0
  tapCount = 0
  tapTimeoutId = null
  maxTapInterval

  constructor(maxTapInterval = 500) {
    this.maxTapInterval = maxTapInterval
  }

  handlePointerDown = (e: TouchEvent) => {
    const currentTime = new Date().getTime()
    const tapInterval = currentTime - this.lastTapTime

    if (tapInterval < this.maxTapInterval) {
      this.tapCount++
    } else {
      this.tapCount = 1
    }

    this.lastTapTime = currentTime
    //@ts-ignore
    clearTimeout(this.tapTimeoutId)
    //@ts-ignore
    this.tapTimeoutId = setTimeout(() => {
      this.tapCount = 0
    }, this.maxTapInterval)

    this.handleTap(e, this.tapCount)
  }
  //@ts-ignore
  handleTap = (e, tapCount) => {
    // Implement your desired behavior based on the tap count
    console.log(`Tap count: ${tapCount}`)
  }
}

